pragma solidity ^0.8.0;
import "../../lib/TransferHelper.sol";
import "../../interface/token721/IRbtDeposit721.sol";
import "../../token721/Governance721.sol";
import "../../ref/CoreRef.sol";
import "../../interface/IRbtVip.sol";
contract VipExchangeMarket is CoreRef{
    
  struct NFTRecording {
    address owner;//所有者地址
    uint tokenId;//令牌id
    uint  id;//交易市场上的序号
    uint price;//价格
    uint expireTime;//到期时间
    uint status;//状态  0未交易，1已交易
  }
  
  NFTRecording[] public list;
  address rbt;
  //第三方中介地址第三方中介地址
  address agent;
  address vipToken;
  event SellToken(address from,uint tokenId,uint sellPrice);
  event BidToken(address  from,uint id, uint bid);
  event Revocation(uint indexed id);
  //构造函数
  constructor(address core)CoreRef(core){}
    
  function init(address _agent,address _rbt,address _vipToken) external {
    rbt=_rbt;
    agent= _agent;
    vipToken=_vipToken;
    }
 
  //出售市场（设置令牌出售相关信息）
  function sellToken(address from,uint tokenId,uint sellPrice) public{
    //当前区块的时间，在unit32范围内
    uint32 blockTime = uint32(block.timestamp % 2 ** 32);
    //令牌有效期
    //uint time=Governance721(_types).expire(tokenId);
    uint time=IRbtVip(vipToken).getVipInfo(tokenId).expireTime;
    //查看调用者是否是tokenid所有者以及令牌不能过期
    require(from==IRbtVip(vipToken).getVipInfo(tokenId).owner&&time>=blockTime,'The address cannot be set');
    uint id=list.length+1;
    NFTRecording memory record = NFTRecording({
      owner:from,//出售者地址
      tokenId:tokenId,//出售令牌id
      id:id,//tokenId在数组中的位置
      price:sellPrice,//出售价格
      expireTime:time,//到期时间
      status:0//未交易
    });
    list.push(record);
    //将令牌交给第三方中介
    IRbtVip(vipToken).safeTransferFrom(from,agent, tokenId);
    emit SellToken(from,tokenId,sellPrice);
  }

  //购买人出价  
  function bidToken(address from,uint id, uint bid) public {
    //保证出价和售价相等
    require(bid==list[id-1].price,'Can not buy');
    //将rbt转给商家
    TransferHelper.safeTransferFrom(rbt,from,list[id-1].owner, bid);
    //交易手续费 （手续费待定）
    uint serviceCharge=bid*5/1000;
    //出售人将手续费转给银行
    TransferHelper.safeTransferFrom(rbt,list[id-1].owner,agent, serviceCharge);
    //将令牌转移给购买人
    IRbtVip(vipToken).safeTransferFrom(agent,from,list[id-1].tokenId);
    //更改凭证状态
    list[id-1].status=1;
    emit BidToken(from,id,bid);
  }
 
    //撤销出售
  function revocation(uint id)public{
    require(msg.sender==list[id-1].owner&&list[id-1].status==0,"The current user has no permissions");
    //第三方中介归还将令牌归还贷款人
    IRbtVip(vipToken).safeTransferFrom(agent,msg.sender, list[id-1].tokenId);
    //删除在list中的记录
    delete list[id-1];
    emit Revocation(id);
  }
  
}
